import heapq

def maxOverlapping(intervals):
    intervals.sort()
    (heap, maxOverlap) = ([intervals[0][1]], 2)
    for (start, end) in intervals[1:]:
        while heap and heap[0] <= start:
            heapq.heappop(heap)
        heapq.heappush(heap, end)
        maxOverlap = max(maxOverlap, len(heap))
    return maxOverlap

